import React from 'react';

const ArticlePage = () => (
  <div className="bg-background text-primary-foreground min-h-screen flex flex-col items-center justify-center">
    <h1 className="text-4xl text-black font-bold mb-4">Article 1</h1>
    <p className="text-lg text-black">This is the content of Article 1.</p>
  </div>
);

export default ArticlePage;
